import React from 'react';

function Auth() {
    return (
        <div>
            <div className="row justify-content-center">
                <h1>Effettua il login prima di entrare nell'area privata</h1>
            </div>
            <div className="row justify-content-center">
                <form>
                    <div className="row">
                        <input className="input-group" type="text" placeholder="Nome Utente"></input>
                    </div>
                </form>
            </div>
        </div>
    );
}

export default Auth;
